/** @format */

import React, { Fragment } from "react";
import { Button, Grid, Box } from "@mui/material";

const Templates = () => {
  return (
    <Fragment>
      <Grid container spacing={1}>
        <Grid item xs={3}>
          <Box
            sx={{
              height: "80%",
              width: "80%",
              borderRadius: "2rem",
            }}
          >
            <Button variant="contained" fullWidth>
              Word Template
            </Button>
          </Box>
        </Grid>
        <Grid item xs={3}>
          <Box
            sx={{
              height: "80%",
              width: "80%",
              borderRadius: "2rem",
            }}
          >
            <Button variant="contained" fullWidth>
              PDF Template
            </Button>
          </Box>
        </Grid>
        <Grid item xs={3}>
          <Box
            sx={{
              height: "80%",
              width: "80%",
              borderRadius: "2rem",
            }}
          >
            <Button variant="contained" fullWidth>
              Email Template
            </Button>
          </Box>
        </Grid>
        <Grid item xs={3}>
          <Box
            sx={{
              height: "80%",
              padding: "5rem 2rem 5rem 2rem",
              width: "80%",
              backgroundColor: "darkGray",
              borderRadius: "2rem",
            }}
          >
            Space for 2nd Document to be opend if user wants it
          </Box>
        </Grid>
      </Grid>
    </Fragment>
  );
};

export default Templates;
